// Filename - "./components/Navbar.js

import React from "react";
import { Nav, NavLink, NavMenu } from "./NavbarElements";

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavMenu>
                    <NavLink to="/themansion" activeStyle>
                        The Mansion
                    </NavLink>
                </NavMenu>
            </Nav>
        </>
    );
};
export default Navbar;
